import React from 'react';
import { View, Text, StyleSheet } from 'react-native';
import Head from '../Home/Head';
import { PackageIcons } from './';

const Packages = () => {
    return (
        <View>
            <PackageIcons />
            <Head />>
        </View>
    );
}

const styles = StyleSheet.create({})

export default Packages;
